import React from 'react';
import Todo from './Todo';

const ToDoList = ({ todoList, handleToggle, handleFilter }) => {
    return (
            <ul>
                {todoList.map(todo => {
                    return (
                        <Todo todo={todo} handleToggle={handleToggle} handleEdit={handleToggle}/>
                    )
                })}
            </ul>
    );
};

export default ToDoList;
